import React from "react";

function Quote(props) {
  let imageNumber = Math.floor(Math.random() * (3) + 0);
  return (
    <div>
      <img src={require(`../images/${imageNumber}.jpg`)} />
      <div>{props.text}</div>
    </div>
  );
}

export default Quote;
